import React from 'react';

function Card({ card, onCardClick }) {
  function handleClick() {
    onCardClick(card);
  }
  return (
    <li className="item">
      <button type="button" className="item__trash" aria-label="Кнопка удаления"></button>
      <img src={card.link} alt={card.name} className="item__image" onClick={handleClick} />
      <div className="item__info">
        <h2 className="item__name"></h2>
        <div className="item__like-block">
          <button type="button" className="item__like" aria-label="Кнопка лайка"></button>
          <p className="item__like-counter">0</p>
        </div>
      </div>
    </li>
  );
}
export default Card;
